import React from 'react';
import apiClient from '../services/api';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import NewTask from './NewTask';


export default class EmpTask extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            tasks: [],
        };
    }



    fetchTasks = () => {
        if (sessionStorage.getItem('loggedIn')) {
            apiClient.get('sanctum/csrf-cookie').then(() => apiClient.post('/api/employeeTasks')
                .then(response => {
                    this.setState({ tasks: response.data })
                    //console.log(response,"response");
                    //console.log(response.data[0].project,"response.data");
                })
                .catch(error => console.error(error)))

        }
      // console.log(this.state.projects.project,"projectsss");

    }

    componentDidMount() {
        this.fetchTasks();
    }




    render() {

        return (
            <div classsName="row"   >
                {this.state.tasks.map((tasks) => {
                    return (
                        <div className="col">
                            <div className="card border-left-primary shadow h-100 py-2">
                                <div className="card-body">
                                    <div className="row no-gutters align-items-center" >
                                        {/* <div className="col mr-2"> */}
                                        <div className="col mr-2  m-0 font-weigt-bold text-primary text-uppercase mb-2"> {tasks.taskName}</div>
                                        <div className="col mr-2  m-0 font-weigt-bold text-primary text-uppercase mb-2"> {tasks.employee.name}</div>
                                        <div className="col mr-2   m-0 font-weigt-bold text-primary text-uppercase mb-2"> {tasks.percentage}</div>
                                        <div className="col mr-2">
                                            <div className="section">  <span className="trash" onClick={() => { this.handleDeleteTask(tasks.id) }}>Delete
                                                                <span></span>
                                                <i></i>
                                            </span>
                                            </div>
                                        </div>
                                    </div> </div></div>
                        </div>
                    )
                })}


            </div>



        )
    }
}
